import { useState } from 'react';
import Button from './Button';

function App() {
    const [countValue, setCountValue] = useState(0);
    function clicked() {
        setCountValue((prev) => prev + 1);
    }
    return (
        <div className="App">
            <h1>{countValue}</h1>
            <button onClick={clicked}>click me</button>
        </div>
    );
}

export default App;
